/**
	Modify the description here. Modify the function name and parameters as needed. One function per
	template is recommended; create a new code template for each new function.

	@param {String} arg1 - arg1 description
	@return {String} return description
*/

function jsonResponseMaker(resultData, principal) {
	principal = principal || false;
	response = {};
	patientFlag = false;
	organizationFlag = false;
	carePlanFlag = false;
	operationOutcomeFlag = false;

	for (var key in resultData) {

		if (	key === 'extNormCotizante' || 
			key === 'extApellidoMat' || 
			key === 'extNombres' || 
			key === 'ExtSexo' || 
			key === 'extFechaNacimi' || 
			key === 'extCodEstBen' || 
			key === 'extDescEstado' || 
			key === 'extRutCotizante' || 
			key === 'extNomCotizante' || 
			key === 'extDirPaciente' || 
			key === 'extGlosaComuna' || 
			key === 'extGlosaCiudad' || 
			key === 'extPrevision' || 
			key === 'ExtGlosa') {

				if (patientFlag === false)
				{
					patientFlag = true;
					response['Patient'] = {};
				}


				response['Patient'][key] = resultData[key];
		}

		else if (
			key === 'extNivel' || 
			key === 'extTipoPrestador' || 
			key === 'extCodEspecialidades' || 
			key === 'extCodProfesiones' || 
			key === 'extAnosAntiguedad') {

				if (organizationFlag === false)
				{
					organizationFlag = true;
					response['Organization'] = {};
				}
				response['Organization'][key] = resultData[key];
			}


		else if (key === 'ExtPlan') {

			if (carePlanFlag === false)
			{
				carePlanFlag = true;
				response['CarePlan'] = {};
			}
			response['CarePlan'][key] = resultData[key];
		}

		else if (
			key === 'extCodError' ||
			key === 'extMensajeError') {

				if (operationOutcomeFlag === false)
				{
					operationOutcomeFlag = true;
					response['OperationOutcome'] = {};
				}
				response['OperationOutcome'][key] = resultData[key];
		}
	}

	return response;
}

